contracts/Airdrop.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;
import {IERC20} from "./ERC20.sol";

/**
* 通过该合约可将某账户下的token与eth转移至指定账户中
*/
contract Airdrop {
    address public tokenAddr;

    constructor(address _tokenAddr) {
        tokenAddr=_tokenAddr;
    }

    function getSum(uint256[] calldata arr) public pure returns(uint sum) {
        for (uint8 i; i < arr.length; i++) {
            sum += arr[i];
        }
    }

    function multiTransferToken(address[] calldata _addrs,uint256[] calldata _amounts) external {
        require(_addrs.length == _amounts.length,"length not equal");
        IERC20 token = IERC20(tokenAddr);
        require(token.allowance(msg.sender, address(this)) >= getSum(_amounts),"Need enough approve amount");

        for (uint8 i; i < _addrs.length; i++) {
            token.transferFrom(msg.sender, _addrs[i], _amounts[i]);
        }
    }

    mapping(address=>uint256) public failTransferList;

    function multiTransferEth(address[] calldata _addrs,uint256[] calldata _amounts) external payable {
        require(_addrs.length == _amounts.length,"length not equal");
        uint amount = getSum(_amounts);
        require(msg.value == amount,"msg.value error");

        for (uint8 i; i < _addrs.length; i++) {
            (bool success, ) = _addrs[i].call{value:_amounts[i]}("");
            if (!success) {
                failTransferList[_addrs[i]] = _amounts[i];
            }
        }
    }
}

contracts/ERC20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

interface IERC20 {
    function balanceOf(address account) external returns(uint);

    function allowance(address owner,address spender) external returns(uint);

    function totalSupply() external returns (uint);

    function transfer(address receiver,uint amount) external returns(bool);

    function approve(address recipient,uint amount) external returns(bool);

    function transferFrom(address sender,address recipient,uint amount) external returns (bool);

    event Transfer(address indexed sender,address indexed receiver,uint amount);

    event Approve(address indexed owner,address indexed spender,uint amount); 
} 

contract ERC20 is IERC20 {
    mapping(address=>uint) public balanceOf;
    mapping(address=>mapping(address=>uint)) public allowance;

    uint public totalSupply;
    string public symbol;
    uint8 public decimals;

    constructor(uint256 _totalSupply,string memory _symbol,uint8 _decimals) {
        totalSupply = _totalSupply;
        symbol = _symbol;
        decimals = _decimals;
    }



    function transfer(address receiver,uint amount) external returns(bool) {
        balanceOf[msg.sender] -= amount;
        balanceOf[receiver] += amount;
        emit Transfer(msg.sender, receiver, amount);
        return true;
    }

    // 通过CrowdFund合约使用ERC20合约,加深了理解:
    // 相当于调用的外币账户地址授权了CrowdFund合约账户:此token transferFrom的额度
    function approve(address recipient,uint amount) external returns(bool) {
        allowance[msg.sender][recipient] = amount;
        emit Approve(msg.sender, recipient, amount);
        return true;
    }

    // 在CrowdFund的例子中,调用transferFrom是为了众筹pledge,此时sender是一个外部账户,recipient就是CrowdFund合约账户
    // 因此在pledge之前,需要用所有可能参与众筹的外部账户approve一下CrowdFund合约账户
    // 代表到时候合约账户的逻辑中,可以调用transferFrom,从sender转账给recipient
    function transferFrom(address sender,address recipient,uint amount) external returns (bool) {
        // 调用transferFrom方法的是一个合约，通过该合约从sender转token给recipient，减少的额度是从sender给转账合约的额度
        allowance[sender][msg.sender] -= amount;
        balanceOf[sender] -= amount;
        balanceOf[recipient] += amount;

        return true;
    }

    function _mint(address to,uint256 amount) public {
        balanceOf[to] += amount;
        totalSupply += amount;
        emit Transfer(address(0), to, amount);
    }

    function mint(uint amount) public {
        balanceOf[msg.sender] += amount;
        totalSupply += amount;
        emit Transfer(address(0), msg.sender, amount);
    }

    function _burn(address from,uint256 amount) public {
        balanceOf[from] -= amount;
        totalSupply -= amount;
         emit Transfer(from ,address(0) , amount);
    }

    function burn(uint amount) public {
        balanceOf[msg.sender] -= amount;
        totalSupply -= amount;
        emit Transfer(msg.sender,address(0) , amount);
    }


}

